import React from 'react';
import Header from './components/Header';
import ProductList from './components/ProductList';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <img src="/images/bannerImage.jpeg" alt="Banner" className="banner-image" />
      <ProductList />
      <Footer />
    </div>
  );
}

export default App;
